	.loader_c {
		position: absolute;
		width: 100%;
		height: 100%;
		/*background: radial-gradient(ellipse, #09bbfe 5%, #5a42ec 87%);*/
		background-color: #000000;
	}

	.container {
		position: absolute;
		left: 50%;
		width: 50%;
		top: 45%;
		height: 40%;
		max-height: 80vh;
		transform: translate(-50%, -50%);
		background: var(--logo-image) top center/auto 50% no-repeat;
		background-size: contain;
	}

	.progress-bar {
		position: absolute;
		bottom: -7%;
		width: 150%;
		box-sizing: border-box;
		/*border: solid 0.1em #1a1685;*/
		height: 0.3em;
		left: 50%;
		transform: translate(-50%, -50%);
		border-radius: 0.4em;
		/*background: linear-gradient(180deg, #3e3a95, #544fc5);*/
		font: clamp(0.625em, 10vw, 8em) monospace;
		/*box-shadow: 0 0 0.3em 0.05em #2a259b,*/
		/*inset 0 0 0.015em 0.01em #2a259b;*/
	}

	.progress-bar::-webkit-progress-bar {
		background: transparent;
	}

	.progress-bar::-webkit-progress-value {
		border-radius: 0.35em;
		/*box-shadow: inset 0 0.1em 0.1em rgba(255, 255, 255, 0.45);*/
		background: var(--fill);
	}

	.progress-bar::-moz-progress-bar {
		border-radius: 0.35em;
		/*box-shadow: inset 0 0.1em 0.1em rgba(255, 255, 255, 0.45);*/
		background: var(--fill);
	}

	.text {
		position: absolute;
		display: flex;
		justify-content: center;
		top: 111%;
		width: 100%;
		transform: scaleY(0.85);
		font-family: "Trebuchet MS", "Lucida Sans Unicode", "Lucida Grande", "Lucida Sans", Arial, sans-serif;
		color: #fff;
		font-size: 4vw;
		font-weight: 600;
		text-align: center;
		letter-spacing: 0.5px;
	}

	.dots {
		letter-spacing: 0;
		margin-left: 3px;
	}

	.dots > span {
		display: inline-block;
		width: 1vw;
		height: 0.55vh;
		opacity: 0;
		background: #fff;
		border-radius: 50%;
		animation: blink 1.5s infinite backwards;
		animation-fill-mode: both;
	}

	.dots > span:nth-child(2) {
		animation-delay: .2s;
	}

	.dots > span:nth-child(3) {
		animation-delay: .4s;
	}

	@media (orientation: landscape) {
		.container {
			top: 40%;
			height: 50%;
		}

		.text {
			font-size: 5vh;
			top: 115%;
		}

		.dots > span {
			width: 1vh;
			height: 0.55vw;
		}

		.progress-bar {
			bottom: -15%;
			width: 85%;
			font: clamp(0.625em, 6.5vw, 3em) monospace;
		}
	}

	@keyframes blink {

<script>
	const onDOMReady = () => {
		const progress = document.querySelector('.progress-bar');
		const timeStamp = Date.now();
		const dProgress = 0.06;

		const increaseProgress = () => {
			const dt = Date.now() - timeStamp;
			progress.value = dt * dProgress + 10;
			if (progress.value < 100) {
				requestAnimationFrame(increaseProgress);
			}
		};

		requestAnimationFrame(increaseProgress);
	};
	document.addEventListener('DOMContentLoaded', onDOMReady);
</script>
